{
  "openapi": "3.0.0",
  "info": {
    "version": "1.0.0",
    "title": "Ontobud Application API",
    "description": "Ontobud Backend Application API documentation",
    "contact": {
      "name": "Francisco Oliveira",
      "email": "a78416@alunos.uminho.pt"
    },
    "license": {
      "name": "MIT",
      "url": "https://opensource.org/licenses/MIT"
    }
  },
  "servers": [
    {
      "url": "http://epl.di.uminho.pt:8738/api",
      "description": "Main server"
    },
    {
      "url": "http://localhost:5000/api",
      "description": "Testing server"
    }
  ],
  "tags": [
    {
      "name": "Auth",
      "description": "Requests related to User Authentication"
    },
    {
      "name": "RDF4J",
      "description": "Requests related to RDF4J Server"
    },
    {
      "name": "RDF4J Query",
      "description": "RDF4J Server SPARQL 1.1 queries"
    },
    {
      "name": "Mongo",
      "description": "Requests related to MongoDB"
    }
  ],
  "paths": {
    "/auth/signup": {
      "post": {
        "tags": [
          "Auth"
        ],
        "summary": "Create new user account",
        "description": "Create new user account.",
        "requestBody": {
          "description": "User account details.",
          "required": true,
          "content": {
            "application/x-www-form-urlencoded": {
              "schema": {
                "type": "object",
                "properties": {
                  "name": {
                    "type": "string"
                  },
                  "email": {
                    "type": "string"
                  },
                  "password": {
                    "type": "string"
                  }
                },
                "required": [
                  "name",
                  "email",
                  "password"
                ]
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "New user is created, and returns JSON user object",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/User"
                }
              }
            }
          },
          "500": {
            "description": "Creation failed. Likely duplicate key (already used email)"
          }
        }
      }
    },
    "/auth/login": {
      "post": {
        "tags": [
          "Auth"
        ],
        "summary": "Login with user account",
        "description": "Login with user account.\nReturns JWT token to be used as authorization for some requests and User name and email.\n",
        "requestBody": {
          "description": "Login credentials.",
          "required": true,
          "content": {
            "application/x-www-form-urlencoded": {
              "schema": {
                "type": "object",
                "properties": {
                  "email": {
                    "type": "string"
                  },
                  "password": {
                    "type": "string"
                  }
                },
                "required": [
                  "email",
                  "password"
                ]
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "JWT access token and User info. JWT will be required in some requests for Authorization."
          },
          "404": {
            "description": "Login failed. Likely wrong email ou password."
          }
        }
      }
    },
    "/auth/user": {
      "get": {
        "tags": [
          "Auth"
        ],
        "summary": "Get user info from JWT",
        "description": "Decrypts JWT payload, returning some user account information.\n",
        "security": [
          {
            "bearerAuth": []
          }
        ],
        "responses": {
          "200": {
            "description": "Information returned."
          },
          "401": {
            "description": "Unauthorized"
          }
        }
      }
    },
    "/auth/delete/{email}": {
      "delete": {
        "tags": [
          "Auth"
        ],
        "summary": "Delete user account by email",
        "description": "Delete user account with the specified email.\nOnly the user himself or a admin can delete a account.\n",
        "security": [
          {
            "bearerAuth": []
          }
        ],
        "parameters": [
          {
            "in": "path",
            "required": true,
            "name": "email",
            "description": "Account email to delete",
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Account deleted"
          },
          "401": {
            "description": "Unauthorized"
          }
        }
      }
    },
    "/rdf4j/management/listRepos": {
      "get": {
        "tags": [
          "RDF4J"
        ],
        "summary": "List Repositories",
        "description": "Returns all existing repositories.",
        "responses": {
          "200": {
            "description": "Request success",
            "content": {
              "application/json": {
                "schema": {
                  "type": "array",
                  "items": {
                    "properties": {
                      "readable": {
                        "type": "object",
                        "properties": {
                          "datatype": {
                            "type": "string"
                          },
                          "type": {
                            "type": "string"
                          },
                          "value": {
                            "type": "boolean"
                          }
                        }
                      },
                      "id": {
                        "type": "object",
                        "properties": {
                          "type": {
                            "type": "string"
                          },
                          "value": {
                            "type": "boolean"
                          }
                        }
                      },
                      "title": {
                        "type": "object",
                        "properties": {
                          "type": {
                            "type": "string"
                          },
                          "value": {
                            "type": "boolean"
                          }
                        }
                      },
                      "uri": {
                        "type": "object",
                        "properties": {
                          "type": {
                            "type": "string"
                          },
                          "value": {
                            "type": "boolean"
                          }
                        }
                      },
                      "writable": {
                        "type": "object",
                        "properties": {
                          "datatype": {
                            "type": "string"
                          },
                          "type": {
                            "type": "string"
                          },
                          "value": {
                            "type": "boolean"
                          }
                        }
                      }
                    }
                  }
                }
              },
              "text/csv": {
                "schema": {
                  "type": "string"
                }
              }
            }
          },
          "400": {
            "description": "Bad request."
          }
        }
      }
    },
    "/rdf4j/management/create": {
      "put": {
        "tags": [
          "RDF4J"
        ],
        "summary": "Create a new Repository",
        "requestBody": {
          "description": "Configuration values.",
          "required": true,
          "content": {
            "application/x-www-form-urlencoded": {
              "schema": {
                "type": "object",
                "properties": {
                  "type": {
                    "type": "string",
                    "enum": [
                      "native",
                      "native-rdfs-dt",
                      "memory",
                      "memory-rdfs-dt"
                    ],
                    "default": "native"
                  },
                  "Repository ID": {
                    "type": "string"
                  },
                  "Repository Title": {
                    "type": "string"
                  },
                  "Persist": {
                    "type": "boolean",
                    "default": true
                  }
                },
                "required": [
                  "type",
                  "Repository ID",
                  "Repository Title"
                ]
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Create success."
          },
          "400": {
            "description": "Bad request."
          },
          "409": {
            "description": "Repository already exists."
          },
          "500": {
            "description": "Internal Error. Likely configuration error. Possibly bad configuration values."
          }
        }
      }
    },
    "/rdf4j/management/update": {
      "post": {
        "tags": [
          "RDF4J"
        ],
        "deprecated": true,
        "summary": "Update existing Repository",
        "requestBody": {
          "description": "New configuration values. Only 'Repository ID' cannot be changed. Any other given\nconfiguration will replace the previous. **NOTE** if the new configuration is not\ncompatible with the previous **information can be lost**.\n",
          "required": true,
          "content": {
            "application/x-www-form-urlencoded": {
              "schema": {
                "type": "object",
                "properties": {
                  "type": {
                    "type": "string",
                    "enum": [
                      "native",
                      "native-rdfs-dt",
                      "memory",
                      "memory-rdfs-dt"
                    ],
                    "default": "native"
                  },
                  "Repository ID": {
                    "type": "string"
                  },
                  "Repository Title": {
                    "type": "string"
                  },
                  "Persist": {
                    "type": "boolean",
                    "default": true
                  }
                },
                "required": [
                  "Repository ID"
                ]
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Create success."
          },
          "400": {
            "description": "Bad request."
          },
          "404": {
            "description": "Repository does not exist"
          },
          "500": {
            "description": "Internal Error. Likely configuration error. Possibly bad configuration values."
          }
        }
      }
    },
    "/rdf4j/management/delete/{repository}": {
      "delete": {
        "tags": [
          "RDF4J"
        ],
        "summary": "Delete a Repository",
        "parameters": [
          {
            "in": "path",
            "required": true,
            "name": "repository",
            "description": "Target Repository",
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Delete success."
          },
          "400": {
            "description": "Bad request."
          },
          "404": {
            "description": "Repository does not exist"
          }
        }
      }
    },
    "/rdf4j/management/delete/{repository}/statements": {
      "delete": {
        "tags": [
          "RDF4J"
        ],
        "summary": "Clear all Repository statements/triples",
        "parameters": [
          {
            "in": "path",
            "required": true,
            "name": "repository",
            "description": "Target Repository",
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "description": "Clear success."
          },
          "400": {
            "description": "Bad request."
          },
          "404": {
            "description": "Repository does not exist"
          }
        }
      }
    },
