  "components": {
    "securitySchemes": {
      "bearerAuth": {
        "type": "http",
        "scheme": "bearer",
        "bearerFormat": "JWT"
      }
    },
    "schemas": {
      "User": {
        "required": [
          "_id",
          "name",
          "email",
          "password",
          "__v"
        ],
        "properties": {
          "_id": {
            "type": "string",
            "uniqueItems": true,
            "example": "5da988f5204a53011f3b3e49"
          },
          "name": {
            "type": "string",
            "example": "test"
          },
          "email": {
            "type": "string",
            "uniqueItems": true,
            "example": "test@email"
          },
          "password": {
            "type": "string",
            "example": "$2b$10$7SVjTqc7BGf8/P83WN5CPOYlBcKzEIdfSbhEEl3vbpARswHccGtke"
          },
          "__v": {
            "type": "number",
            "example": 0
          }
        }
      },
      "SavedQuery": {
        "required": [
          "_id",
          "user_email",
          "name",
          "query",
          "__v"
        ],
        "properties": {
          "_id": {
            "type": "string",
            "uniqueItems": true,
            "example": "5da988f5204a53011f3b3e49"
          },
          "user_email": {
            "type": "string",
            "uniqueItems": true,
            "example": "test@email"
          },
          "name": {
            "type": "string",
            "uniqueItems": true,
            "example": "QueryExample"
          },
          "query": {
            "type": "string",
            "example": "select * where { ?s ?p ?o } limit 100"
          },
          "repoID": {
            "type": "string",
            "description": "Contains the repoID of the repository associated with this query. Doesnt exist if the query is global (not associated to a specific repository)",
            "example": "repo"
          }
        }
      },
      "Feedback": {
        "required": [
          "_id",
          "rating",
          "intuitive",
          "style",
          "anyBugs",
          "useAgain",
          "__v"
        ],
        "properties": {
          "_id": {
            "type": "string",
            "uniqueItems": true,
            "example": "5da988f5204a53011f3b3e49"
          },
          "message": {
            "type": "string",
            "example": "feedback message"
          },
          "rating": {
            "type": "number",
            "example": 5
          },
          "intuitive": {
            "type": "number",
            "example": 3
          },
          "style": {
            "type": "number",
            "example": 3
          },
          "anyBugs": {
            "type": "number",
            "example": 0
          },
          "useAgain": {
            "type": "number",
            "example": 0
          },
          "__v": {
            "type": "number",
            "example": 0
          }
        }
      },
      "Repository": {
        "required": [
          "id",
          "name",
          "owner_email"
        ],
        "properties": {
          "id": {
            "type": "string",
            "uniqueItems": true
          },
          "name": {
            "type": "string"
          },
          "owner_email": {
            "type": "string"
          }
        }
      }
    }
  }
